
function GlobalMasterPage(){$('[data-toggle="tooltip"]').tooltip();$("#menu *[data-keywords]").each(function(){$(this).parent("ul").parent("li").data("keywords",$(this).data("keywords"))})}GlobalMasterPage.prototype.functionalitySearch=function(a){if(a.length<=0){$("#menu *[data-keywords], #menu li").show();return}var b=a.toLowerCase().split(" ");$("#menu *[data-keywords], #menu li").each(function(){console.log($(this).data("keywords"));var e=$(this).data("keywords").split(" ");var f=false;for(var d=0;d<b.length&&!f;d++){for(var c=0;c<e.length&&!f;c++){if(e[c].indexOf(b[d])!==-1){f=f||true}}}if(f){$(this).show()}else{$(this).hide()}})};GlobalMasterPage.prototype.toggleMenu=function(){if($("#menu_container").is(":hidden")){$("#menu_container").hide();$("#menu_container").removeClass("hidden-xs")}$("#menu_container").toggle(function(){if($("#menu_container").is(":hidden")){$("#menu_container").addClass("hidden-xs");$("#menu_container").show()}});$("#content").toggle()};$(function(){var a=new GlobalMasterPage();$("#toggle_menu").click(function(){a.toggleMenu()});$("#search_functionality_text").keyup(function(){a.functionalitySearch($(this).val())})});